import React from 'react';
import PropTypes from 'prop-types';
import "./Users.css";
import NewUserForm from './NewUserForm';



const Users = (props) => {
  return (

      <section className='log-in'> Please Sign in or Create an Account!
      <p>
        <button onClick={() => props.onboardClick(props.board_id)}>Log in </button>
        <button onClick ={() => props.onboardClick(props.board_id)}> Create Account</button>
        <NewUserForm/>
      </p>
      Current created users:
      <p>User:  {props.user_id} </p>
      <p>Username : {props.username}</p>

      </section>



  )
};

Users.propTypes = {
  user_id: PropTypes.number.isRequired,
  address: PropTypes.string.isRequired,
  username:PropTypes.string.isRequired,

}

export default Users;
